INSERT INTO contents (contentid,contenttype,descr,status,workxml,created,lastmodified,onlinexml,published,sync,maingroup,currentversion,lasteditor,firsteditor,restriction) VALUES ('NWS638','NWS','Manufacturers Respond to Coronavirus','PUBLIC','<?xml version="1.0" encoding="UTF-8"?>
<content id="NWS638" typecode="NWS" typedescr="News"><descr>Manufacturers Respond to Coronavirus</descr><groups mainGroup="free" /><categories><category id="news" /></categories><attributes><attribute name="title" attributetype="Text"><text lang="en">Manufacturers Respond to Coronavirus</text></attribute><attribute name="subtitle" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>Companies are moving quickly to stay viable and position themselves for recovery</p>
]]></hypertext></attribute><attribute name="body" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>For manufacturers of every size in every industry, it&rsquo;s no exaggeration to say that the coronavirus crisis has changed everything. Demand for products has been upended, relationships with suppliers and customers are being tested and liquidity issues have multiplied. Some manufacturers are pivoting to create essential gear to help combat the pandemic, while others are retooling in advance of future needs, and all are trying to keep their workers safe. Abhijit Bhide, managing director, Bank of America Global Banking and Markets, answers questions about this unprecedented upheaval and how businesses can respond now and in the months ahead.</p>
]]></hypertext></attribute><attribute name="img" attributetype="Image"><resource resourcetype="Image" id="639" lang="en" /><text lang="en">coronavirus</text></attribute><list name="links" attributetype="Monolist" nestedtype="Link"><attribute name="links" attributetype="Link"><link type="external"><urldest>http://www.mysite.com/</urldest></link><text lang="en">mio sito</text><properties /></attribute><attribute name="links" attributetype="Link"><link type="external"><urldest>http://www.mysite.com/</urldest></link><text lang="en">mio sito 2</text><properties /></attribute></list><list name="attaches" attributetype="Monolist" nestedtype="Attach"><attribute name="attaches" attributetype="Attach"><resource resourcetype="Attach" id="205" lang="en" /><text lang="en">Entando_Admin_Console_Overview_4.3.3_EN.pdf</text></attribute></list></attributes><status>PUBLIC</status><version>1.0</version><firstEditor>admin</firstEditor><lastEditor>admin</lastEditor><lastModified>20200827084425</lastModified></content>','20200827084321','20200827084425','<?xml version="1.0" encoding="UTF-8"?>
