<content id="NWS641" typecode="NWS" typedescr="News"><descr>How to tackle financial stress</descr><groups mainGroup="free" /><categories><category id="news" /></categories><attributes><attribute name="title" attributetype="Text"><text lang="en">How to tackle financial stress</text></attribute><attribute name="subtitle" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>suggestions for how to help reduce your money stress and get motivated to take control of your finances</p>
]]></hypertext></attribute><attribute name="body" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>For many Americans, financial concerns are ever present, especially given the uncertainties of today&rsquo;s economy. While worrying doesn&rsquo;t solve much, having a plan to try to manage financial challenges can help ease some of that stress. Plus, the monetary benefits of dealing with financial problems&mdash;getting bills paid, saving more, paying down expensive debt&mdash;can help improve your overall outlook.</p>
