INSERT INTO contents (contentid,contenttype,descr,status,workxml,created,lastmodified,onlinexml,published,sync,maingroup,currentversion,lasteditor,firsteditor,restriction) VALUES ('PRD673','PRD','Seed International Travel','PUBLIC','<?xml version="1.0" encoding="UTF-8"?>
<content id="PRD673" typecode="PRD" typedescr="Products"><descr>Seed International Travel</descr><groups mainGroup="administrators"><group name="administrators" /></groups><categories><category id="travels" /><category id="my_product" /></categories><attributes><attribute name="title" attributetype="Text"><text lang="en">Seed International Travel</text></attribute><attribute name="subtitle" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>Seed International travel provides comprehensive cover for expats who are living or travelling outside of their home country for an extended period of time.</p>
]]></hypertext></attribute><list name="paragraphs" attributetype="Monolist" nestedtype="Composite"><composite name="paragraphs" attributetype="Composite"><attribute name="mtitle" attributetype="Text" /><attribute name="mbody" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>International Travel Insurance protects you in the event of an illness or injury when traveling outside of your country of residence. It provides key medical benefits in case of an emergency.<br />
Traveling abroad is an exciting experience, but unpredictable illnesses and accidents can happen. Even worse, the resulting medical bills can be overwhelming. The level of international medical coverage provided by your domestic insurance provider can vary greatly depending on your plan, so you may have very limited coverage or no coverage at all. A travel medical insurance plan can provide the coverage you need.</p>
]]></hypertext></attribute><attribute name="mimage" attributetype="Image" /></composite><composite name="paragraphs" attributetype="Composite"><attribute name="mtitle" attributetype="Text"><text lang="en">Why Do I Need Travel Medical Insurance?</text></attribute><attribute name="mbody" attributetype="Hypertext"><hypertext lang="en"><![CDATA[<p>Depending on where you travel, you may encounter language and currency barriers that prevent you from accessing high-quality medical care.<br />
Traveling unprotected can leave you vulnerable to paying high out-of-pocket medical expenses, and navigating a foreign health care system without the assistance you need.<br />
However, with a travel medical insurance plan, you can worry less and experience more knowing you have medical coverage and a trusted health advisor who can support you in your time of need.</p>
]]></hypertext></attribute><attribute name="mimage" attributetype="Image"><resource resourcetype="Image" id="705" lang="en" /><text lang="en">Paragraph_Image_d0 (1).png</text></attribute></composite></list><attribute name="image" attributetype="Image"><resource resourcetype="Image" id="674" lang="en" /><text lang="en">Travel_Insurance_Image_d0 (1).png</text></attribute><list name="links" attributetype="Monolist" nestedtype="Link"><attribute name="links" attributetype="Link"><link type="external"><urldest>http://www.google.it</urldest></link><text lang="en">Discover more</text><properties /></attribute></list><list name="attaches" attributetype="Monolist" nestedtype="Attach"><attribute name="attaches" attributetype="Attach"><resource resourcetype="Attach" id="205" lang="en" /><text lang="en">Entando_Admin_Console_Overview_4.3.3_EN.pdf</text></attribute></list></attributes><status>PUBLIC</status><version>5.0</version><firstEditor>admin</firstEditor><lastEditor>admin</lastEditor><created>20200827093743</created><lastModified>20200828080424</lastModified></content>','20200827093743','20200828080424','<?xml version="1.0" encoding="UTF-8"?>
